import React from "react";
import { NavLink } from "react-router-dom";

const Card = () => {
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="card">
                        <img src={process.env.PUBLIC_URL + "/Images/artwork2.jpg"} className="card-img-top" alt="Random_Image" />
                        <div className="card-body">
                            <h5 className="card-title"></h5>
                            <p className="card-text">Ganesha - Handpainted Art Painting - 32in X 32in</p>
                            <p className="card-text">80 cm X 80 cm</p>
                            <NavLink to="/card-data">By: Community Artists Group</NavLink>
                            <p>11,989</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
};

export default Card;
